  \"2015-12-20T18:52:37.475047\",\n\t\"name\": \"2013-pleasure-craft-and-sailing-vessel-density\",\n\t\"isopen\":
  false,\n\t\"url\": null,\n\t\"notes\": \"Automatic Identification Systems (AIS)
  are a navigation safety device that transmits and monitors the location and characteristics
  of many vessels in U.S. and international waters in real-time. This dataset represents
  the density of pleasure craft and sailing vessel traffic in 2013 for the contiguous
  United States offshore waters from pleasure craft and sailing vessels with AIS transponders
  in 100 meter grid cells. The dataset is best interpreted using a high to low density
  scale and does not represent actual vessel counts.\",\n\t\"license_title\": null,\n\t\"extras\":
